INSERT INTO `category` VALUES ('1', '', '全部', '包含了众多IT方向', '2017-07-27 16:01:49', '2017-07-27 16:01:52');
INSERT INTO `category` VALUES ('2', null, '前端开发', 'Web前端开发是从网页制作演变而来，名称上有很明显的时代特征。在互联网的演化进程中，网页制作是Web1.0时代的产物，早期网站主要内容都是静态，以图片和文字为主，用户使用网站的行为也以浏览为主。随着互联网技术的发展和HTML5、CSS3的应用，现代网页更加美观，交互效果显著，功能更加强大。', '2017-07-29 15:34:53', '2017-07-29 15:34:56');
INSERT INTO `category` VALUES ('3', null, '后端开发', '后端开发是一种不涉及创建生成用户界面的开发。这可能包括后端Web开发，可能也涉及编写API，创建库或和没有用户界面或甚至科学编程系统的系统组件一起工作。在现实中，即使前端开发获得了大部分的荣耀，但是世界上存在的大多数代码（可以说是最有用的代码）是最终用户从来不会看到的后端代码。简单来说，后端开发就是开发人员编写的不能直接看到的代码。', '2017-07-29 17:10:10', '2017-07-29 17:10:40');
INSERT INTO `category` VALUES ('4', null, '移动开发', '移动开发也称为手机开发，或叫做移动互联网开发。是指以手机、PDA、UMPC等便携终端为基础，进行相应的开发工作，由于这些随身设备基本都采用无线上网的方式，因此，业内也称作为无线开发。', '2017-07-29 17:10:13', '2017-07-29 17:10:44');
INSERT INTO `category` VALUES ('5', null, '数据库', '数据库(Database)是按照数据结构来组织、存储和管理数据的仓库，它产生于距今六十多年前，随着信息技术和市场的发展，特别是二十世纪九十年代以后，数据管理不再仅仅是存储和管理数据，而转变成用户所需要的各种数据管理的方式。数据库有很多种类型，从最简单的存储有各种数据的表格到能够进行海量数据存储的大型数据库系统都在各个方面得到了广泛的应用。', '2017-07-29 17:10:19', '2017-07-29 17:10:47');
INSERT INTO `category` VALUES ('6', null, '云计算', '云计算是一种按使用量付费的模式，这种模式提供可用的、便捷的、按需的网络访问，进入可配置的计算资源共享池（资源包括网络、服务器、存储、应用软件、服务），这些资源能够快速提供，只需投入很少的管理工作，或与服务商进行很少的交互。', '2017-07-29 17:10:21', '2017-07-29 17:10:49');
INSERT INTO `category` VALUES ('7', null, '运维测试', '运维，这里指互联网运维，通常属于技术部门，与研发、测试、系统管理同为互联网产品技术支撑的4大部门，这个划分在国内和国外以及大小公司间都会多少有一些不同。\r\n一个互联网产品的生成一般经历的过程是：产品经理、需求分析、研发部门开发、测试部门测试、运维部门部署发布以及长期的运行维护。', '2017-07-29 17:10:25', '2017-07-29 17:10:50');
INSERT INTO `category` VALUES ('8', null, 'UI设计', 'UI设计（或称界面设计）是指对软件的人机交互、操作逻辑、界面美观的整体设计，也叫界面设计。UI设计分为实体UI和虚拟UI，互联网说的UI设计是虚拟UI，UI即User Interface(用户界面)的简称。\r\n好的UI设计不仅是让软件变得有个性有品位，还要让软件的操作变得舒适简单、自由，充分体现软件的定位和特点。', '2017-07-29 17:10:28', '2017-07-29 17:10:51');
INSERT INTO `category` VALUES ('9', null, '其它', '。。。', '2017-07-29 17:10:30', '2017-07-29 17:11:00');
INSERT INTO `course` VALUES ('1', '', '零基础学Python语言', '1', ' 本课程是Python语言零基础入门课程，也是编程零基础入门课程。\r\n\r\n        Python [`paɪθən] 语言，由Guido van Rossum大牛在1989年发明，它是当今世界最受欢迎的计算机编程语言，也是一门“学了有用、学了能用、学会能久用”的计算生态语言。', '2', '0', '/image/banner2.jpg', null, '2017-07-27 16:03:50', '2017-07-27 16:03:53');
INSERT INTO `course` VALUES ('2', null, '大学计算机', '2', '大学计算机 课程2005年被评为山西省精品课程。多年来，该课程教学团队积极探索，锐意进取，进行了多项教学改革和课程实践建设，取得了多项教学改革成果。大学计算机慕课课程是团队集多年的教学经验和实践之积累，依托“十一五”普通高等教育国家级规划教材《大学计算机基础》和山西省\"十二五\"本科规划教材《大学计算机》（第3版》。', '2', '2', '/image/lbt3.jpg', null, '2017-07-29 16:59:27', '2017-07-29 16:59:30');
INSERT INTO `course` VALUES ('5', null, '管理会计学', '3', '随着市场经济的发展繁荣，企业竞争日益激烈，财务转型势在必行。建立和完善现代企业制度，推动财务会计向管理会计变革，增强价值创造力已经成为企业的内在需要。因此，管理会计必将越来越多地受到财务人员和管理当局的重视，成为中国财经领域未来发展的一大趋势。管理会计是指以强化企业内部经营管理、实现最佳经济效益为目的，以现代企业经营活动及其价值表现为对象，通过对财务信息和非财务信息的深加工和再利用，实现对经济过程的预测、决策、预算、控制、责任考核、评价等职能的一个会计分支。本课程以管理的事前、事中和事后职能为起点，介绍了管理会计的基本概念、成本分析方法、长短期经营决策、投资决策、全面预算管理、标准成本分析与责任会计等内容。', '3', '2', '/image/course/03.png', null, '2017-08-01 19:39:07', '2017-08-01 19:39:15');
INSERT INTO `course` VALUES ('3', null, 'C语言程序设计——快速入门与提高', '1', '本着以“计算思维”培养和“计算技术”应用能力提高为目标，用案例教学法，一个编程案例一个台阶的学习计算机编程，每周你都能感觉到计算机运用能力的提升。本课程虽然是面向中学生的零基础的编程课，但编程的精华内容并没有因此而作了简化，也适合大学生、上班族等所有希望编程入门的学习者。', '2', '0', '/image/lbt2.png', null, '2017-07-29 16:59:32', '2017-07-29 16:59:35');
INSERT INTO `course` VALUES ('4', null, '微观经济学 ', '3', '本课程是经济学原理的微观部分，致力于训练学习者建立一个经济学的思维方式，用以解释我们周围的世界，指导我们的日常决策。 微观经济学告诉我们市场机制是如何运行的，商品价格是如何形成的，稀缺资源如何配置到各种产品的生产中去，人们的行为遵循什么样的模式，市场机制是否有效率。', '3', '1', '/image/course/05.png', null, '2017-07-29 16:59:58', '2017-07-29 17:00:02');
INSERT INTO `course` VALUES ('6', null, '心理学与健康', '2', '有人的地方就有心理学，生活中处处都有心理学，所以心理学其实就是让你的生活得更精彩！让你真正懂得你的生活！这就是我们这门课——《心理学与生活》！\r\n    所以如果你愿意，从现在开始，你可以和我一起去看看你的生活中，究竟有哪些有趣的心理学现象，让你自己看到一个丰富多彩的生活世界。\r\n    我将用最生活的语言，教会你最专业的心理学知识，和你一起探索色彩的意义、发现记忆的秘密、揭开人格的面纱、勾勒情感的轮廓、解释人类的行为。\r\n    《心理学与生活》，讲述你自己生活的心理学！\r\n    让我们一起用独具的慧眼看到一个与原先完全不同的生活世界！', '4', '0', '/image/course/06.png', null, '2017-08-01 21:30:14', '2017-08-01 21:30:17');
INSERT INTO `course` VALUES ('7', null, '大学口语', '1', '国防科学技术大学前身是1953年创建的“哈军工”，1970年学校主体南迁长沙，1978年改建为国防科学技术大学。是国防部和教育部双重领导下的国家重点综合性大学，列入国家“985工程”和“211工程”的重点建设。\r\n     《大学英语（口语）》先修课特别适应学有余力的高中生，以话题为内容，以口语技能为牵引，从纵深两个维度上提高学员对英语口语的实际应用能力，修完该门课程，可以更好地适应大学阶段的英语学习，是高中和大学的有力衔接。\r\n      本视频课程共20单元，分20课时讲授，内容广泛涵盖了出国学习和生活中所涉及的主要话题。课程引入雅思考试对口语能力的界定标准和培养方法，在基本日常对话、独立长段输出、多人讨论辩论三个层次上逐步进阶性培养英语口语能力，既为今后有留学计划的学员做应试准备，又全面提高学员日常英语口语输出能力。\r\n      在本课程结束时，学员能够具备进行国际交流时需要的基本口语能力：能就休闲类话题进行日常对话，并自然使用交际策略；能就一般话题进行持续3分钟左右的即兴演说，并做到组织条理清晰，连接自然，细节充分；能够参与抽象类话题的讨论与辩论，做到分析复杂情况，在此基础上发表并支持自己的观点，并驳斥反观点。', '5', '1', '/image/course/07.png', null, '2017-08-01 21:30:20', '2017-08-01 21:30:23');
INSERT INTO `course` VALUES ('8', null, '中国饮食文化', '3', '《中国饮食文化》将重点分析各种饮食思想与观念，探讨如何养成有利于健康的饮食习惯，科学文明地饮食；介绍我国饮食民俗，分析不同地区不同人群的饮食文化差异，讲述经典美食故事；讲解餐桌礼仪，如何吃出风度来；揭示烹饪方法的奥妙，怎样做出一道好菜来；介绍食物营养保健与安全知识要点，怎么吃出健康来；剖析菜点美食赏析的基本要素与创新思路，如何吃出快乐来；介绍中国茶文化与酒文化，讲解品茶饮酒的艺术，怎样喝出滋味来。\r\n本课程将精选我国经典美食的制作视频，汇集各地名食、名茶、名酒、名店、饮食风情资讯，展示中国饮食文化在国外的风貌，汇总中国饮食文化著作、刊物、网站、饮食文化活动的目录与索引，作为课程拓展内容。为大家搭建一个饮食文化交流讨论的平台，打造美食爱好者的共同家园。\r\n饮食与我们每个人休戚相关，饮食文化是人类饮食生活的灵魂，通过本课程的学习，对学习者熟悉餐桌礼仪，养成有利健康的饮食习惯，提高美食鉴赏与创新能力，提高生活质量，传承中华优秀饮食文化，将起到积极的作用。\r\n    课程负责人在华中农业大学已连续讲授《中国饮食文化》20多年，该课程颇受学生欢迎，先后被评为校优质课程、精品视频公开课。\r\n《中国饮食文化》是一门通识课，属于交叉学科，2学分。面向所有专业大、中专学生、研究生和社会公众开放。', '6', '2', '/image/course/08.png', null, '2017-08-01 21:30:25', '2017-08-01 21:30:29');
INSERT INTO `course` VALUES ('9', null, '建筑设计空间基础认知', '2', '《建筑设计空间基础认知》源于哈尔滨工业大学建筑学院的《建筑设计基础》课程，经精炼与拓展，成为，培养学生空间创造力与实践操作能力的建筑学专业空间训练启蒙课程。。课程由“理论教学、设计训练、建筑表现”三个部分有机组成，完整架构了空间完整训练的体系。\r\n在教学内容设置上，本课程以空间训练的基本问题为线索，采用单元模块式教学方式，设置了环境之美、尺规之图、空间之形、功能之用、界面之限、光影之术、组合之构等单元模块，强调对空间认知、体验与建构操作等基本知识的掌握。每个模块是一个完整的单元，整体把握单元模块各个知识点，有明确的训练目标，设计训练围绕相关知识展开。学生在理论学习的同时，需完成相关的设计练习，才能初步掌握空间建构的基本方法。\r\n在师资队伍配置上，课程组教师均为在建筑设计基础课程非常有经验的教师。课程提供理论讲授的知识点视频，还有丰富的富文本作为辅助学习资料，同时还有老师解答设计训练的问题。', '7', '2', '/image/course/09.png', null, '2017-08-01 21:30:31', '2017-08-01 21:30:34');
INSERT INTO `course` VALUES ('10', null, '电路（上）', '1', '\r\n    电路课程是高等院校工科电气、信息和自动化类专业必修的一门重要技术基础课。而电气、信息和自动化类专业又是我国理工科高等教育的重要组成部分，随着经济的发展，这些专业在智能制造、能源互联网、机器人等领域将发挥重要作用，这也对我国相应人才培养提出了更高的要求。《电路》是培养学生掌握现代电路基本理论，学习和理解各专业其它课程的入门课，课程教学是否合适，能不能引导学生对相关专业产生浓厚兴趣，并为后续课程的学习和将来实际应用、从事科学研究奠定扎实的电路理论和实践基础起着重要的作用', '8', '1', '/image/course/10.png', null, '2017-08-01 21:30:37', '2017-08-01 21:30:40');
INSERT INTO `course` VALUES ('11', null, '高等数学先修课', '2', '“高等数学先修课”是连接初等数学和高等数学的桥梁，有利于巩固初等数学知识，为学习高等数学奠定坚实基础。通过引导学生发现问题、解决问题、归纳问题，使得枯燥的数学变得生动、形象。 通过这门课程的学习，可减少文理科学生在数学水平上的差异，激发学习兴趣，带你初步认识高等数学', '9', '0', '/image/course/11.png', null, '2017-08-01 21:30:42', '2017-08-01 21:30:46');
INSERT INTO `course` VALUES ('12', null, '药物分析', '3', ' 中国药科大学“药物分析”课程于1960年在我国率先创办。我校药物分析教学团队率先编著,并一直主编《药物分析》国家级规划教材；“药物分析”课程先后被评为国家精品课程（2008）、国家双语教学示范课程（2010）和国家精品资源共享课（2013）。\r\n     药物分析MOOC是在互联网科技飞速发展的背景下，适应国际药学教育发展的理念和趋势建设的。课程建设围绕专业核心能力培养的目标，针对学术型和应用型人才培养的不同需求，构建了“基础知识—专业能力—高级应用”三个相互衔接又不断递进的知识模块。“基础知识”模块（1-8部分）涵盖了化学分析、光谱分析、色谱分析、体内分析等内容，打破了多门课程独立开设的模式，避免了重复。各类药物的质量分析构成了“专业能力”模块的主要内容（9-11部分）。随着临床药学教育的发展，生物医学检测、安全合理用药和个体化治疗的相关知识已经成为药学应用型人才培养的重要内容，这些知识点构成了 “高级应用”模块（12-15部分）的主体。', '5', '2', '/image/course/12.png', null, '2017-08-01 21:30:48', '2017-08-01 21:30:51');
INSERT INTO `course` VALUES ('13', null, '中国哲学史（先秦部分）', '2', '（一）课程教学目标：通过本课程的教与学，使学习者对中国哲学在先秦时期的发生发展历史有一个较系统、较完整、较清晰的了解和把握。\r\n    （二）课程性质与定位：本课程属于全日制大学本科哲学专业的专业基础课。\r\n    （三）课程设计思路：本课程以中国哲学在先秦时期的历史开展为主线，着重介绍先秦时期的重要哲学家、重要哲学派别、重要哲学典籍和他们的哲学思想。用本课程前辈学者的话说，这种思路对教师来说是“牵藤结瓜”，对学生来说则是“顺藤摸瓜”。所谓“藤”，指这一时期哲学开展的主线；所谓“瓜”，指这一时期的重要哲学家、重要哲学派别、重要哲学典籍和他们的哲学思想。在教与学中，教师与学生都要把握好这种“藤”与“瓜”的关系。\r\n    为了适合MOOC课程的教学要求，使学习者能够在时间相对分散的条件下进行合理而有效的学习，现将“中国哲学史”课程按中国历史进程及中国哲学发展特点，划分成先秦、秦汉至隋唐、宋至清中叶、近代4个部分，每个部分作为一个独立的课程，以35左右课时进行讲授。\r\n    为了让学习者对中国哲学的来龙去脉有较系统、较完整的了解，首先开设的是“中国哲学史（先秦部分）”课程。以后，将依照历史顺序继续开设“中国哲学史（秦汉至隋唐部分）”、“中国哲学史（宋至清中叶部分）”、“中国哲学史（近代部分）”等课程。学习者在对这四门课程进行学习后，也就达到了对全部“中国哲学史”课程学习的目的。', '7', '1', '/image/course/13.png', null, '2017-08-01 21:30:54', '2017-08-01 21:30:57');
INSERT INTO `course` VALUES ('14', null, '社会主义核心价值观修养', '1', '本课程在中央特色社会主义民族理论政策体系框架内全面贯彻习近平总书记有关民族问题的讲话内容，构成12个专题。每专题下设4~5讲微课，加上导言和结语各一讲，共有微课56讲。这56讲微课，每一讲都与中国梦息息相通，每一讲都是中华民族共有家园建设的微言大义，故而统称“民族大义56讲”。它的前身是在“民族大义12和”课堂实录基础上切分的107个知识碎片，2013年作为国家级精品课程主打资源上传，同时配以“习研演练”翻转课堂，形成本校最初的“私播课”。为贯彻落实2014年中央民族工作会议和2015年全国民族教育工作会议精神，特重新设计，由龚永辉、杨社平、郭亮、梁鑫四人联讲，制成“民族大义56讲”原创版。随即通过“翻转课堂”展开“习研演练”，在课堂位育、课际链接乃至校际链接的基础上寻求刷新，现在推出的已是11所高校25位同行联袂主讲的升级版。希望通过更多志同道合者参与刷新，成为更加富有魅力的“民族大义56讲”！！！', '7', '0', '/upload/1531888955182.jpg', null, '2017-08-01 21:31:00', '2018-07-18 12:42:35');
INSERT INTO `course` VALUES ('15', null, '课堂问答的智慧与艺术', '2', '本课程分为五个单元，每个单元之间联系紧密，环环相扣，配合对一线教师的访谈，基于事实的案例研究以及学员间的互相交流讨论，让学员们真正了解问答，掌握课堂。\r\n通过本课程的学习，您将知道课堂问答的环节构成，对目前课堂问答存在的问题有全面了解；同时，您将掌握每个环节应该遵循的原则和具备的技能，对如何设计问题、如何提问、如何理答、如何让学生提问这些问题有一个完整的答案。跟随我们一起学习，您将完善您的课堂问答，让您的课堂更加有趣、有效。\r\n如果您想取得更好地学习效果，有几条建议：\r\n第一，每个单元需要2个小时学习课程内容，2个小时完成作业\r\n第二，请积极对待设置的讨论题，学员间基于个人实践的讨论，将有助于你们加深对课程的理解\r\n第三，建议组建学习小组，组员间轮流说课，加深印象，同时也是一种督促。', '4', '0', '/image/course/15.png', null, '2017-08-01 21:31:05', '2017-08-01 21:31:08');
